import React from 'react';
import {
  BrowserRouter,
  Route,
  Switch,
  Redirect
} from 'react-router-dom';

import Homepage from './pages/Homepage';
import Page from './pages/Page';



function App({}) {


  return (

    <BrowserRouter>

      <Switch>
        <Redirect exact from={["/"]} to="/fr-fr" component={Homepage} />
        <Route path={["/",'/:lang']} component={Homepage} />
        <Route exact path='/:lang/:uid' component={Page} />
        </Switch>


    </BrowserRouter>
  );
}

export default App;
